import styled from 'styled-components';
import './App.module.scss';

const HeaderTitle = styled.h2`
  font-size: 1.5rem;
  font-weight: bold;
  padding: 8px 0;
`;

const Button = styled.button`
  background: #f5f5f5;
  color: #c4c4c4;
  width: 100%;
  border: 1px solid #c4c4c4;
  &:hover {
    background: #3a00e5;
    border-color: #3a00e5;
    color: #fff;
  }
`;

export { HeaderTitle, Button };
